INSERT INTO `star` (`star_id`, `star_type`, `star_name`, `slug`, `star_desc`, `view`, `status`) VALUES
(1, 'actor', 'Oliver Norvell Hardy', 'oliver-norvell-hardy', 'Oliver Norvell Hardy (born Norvell Hardy, January 18, 1892 – August 7, 1957) was an American comic actor and one half of Laurel and Hardy, the double act that began in the era of silent films and lasted from 1927 to 1955. He appeared with his comedy partner Stan Laurel in 107 short films, feature films, and cameo roles. He was credited with his first film, Outwitting Dad, in 1914. In most of his silent films before joining producer Hal Roach, he was billed on screen as Babe Hardy.', 5, 1),
(2, 'actor', 'Larry Semon', 'larry-semon', 'Lawrence \"Larry\" Semon (February 9, 1889 – October 8, 1928) was an American actor, director, producer, and screenwriter during the silent film era. In his day, Semon was considered a major movie comedian, but he is now remembered mainly for working with both Stan Laurel and Oliver Hardy before they started working together.  He is also sometimes noted for directing (as well as appearing in) the 1925 silent film The Wizard of Oz, which had a slight influence on the better-known 1939 talkie The Wizard of Oz released by MGM. The film was included in the 2005 three-disc DVD version of the 1939 film, along with other silent Oz movies.', 7, 1),
(3, 'director', 'Norman Taurog', 'norman-taurog', 'Norman Rae Taurog (February 23, 1899 – April 7, 1981) was an American film director and screenwriter. From 1920 to 1968, Taurog directed 180 films. At the age of 32, he received the Academy Award for Best Director for Skippy (1931). He is the second youngest person ever to win the award after Damien Chazelle, who won for La La Land in 2017. He was later nominated for Best Director for the film Boys Town (1938). He directed some of the best-known actors of the twentieth century, including his nephew Jackie Cooper, Spencer Tracy, Mickey Rooney, Judy Garland, Deanna Durbin, Fred Astaire, Gene Kelly, Deborah Kerr, Peter Lawford, Dean Martin, Jerry Lewis, and Elvis Presley. Taurog directed six Martin and Lewis films, and nine Elvis Presley films, more than any other director. For his contribution to the motion picture industry, Norman Taurog has a star on the Hollywood Walk of Fame at 1600 Vine Street.', 3, 1),
