(114, '', 'County by County', 'County by County', 'county-by-county', '<p>Host Ciara Whelan travels county by county to reveal the best of Ireland: from the broad golden\r\nshores of Sligo and the rolling green hills of Antrim to the misty mountaintops of Kerry and the\r\nbustling excitement of Dublin.<br></p>', '576', '560', NULL, '0', '2021-11-22', '88', '119,152', NULL, '25.40', 'HD', 0, 1, 0, '', 0, 'County by County,Ireland,Dublin,Irish Eyes,Irish Culture,Ireland ', '                Host Ciara Whelan travels county by county to reveal the best of Ireland: from the broad golden shores of Sligo and the rolling green hills of Antrim to the misty mountaintops of Kerry and the bustling excitement of Dublin.                                                                                                                                                ', 'County by County,Ireland,Dublin,Irish Eyes,Irish Culture,Ireland ', '', 1, 1, 56, 56, 56, 57, '2021-11-24 01:13:29'),
(115, '', 'Secrets of a Psychopath', 'Secrets of a Psychopath', 'secrets-of-a-psychopath', '<p>36-year-old Elaine O’Hara had very little to live for. She was overweight, depressed and suffered&nbsp;<span style=\"font-size: 0.875rem;\">from asthma, diabetes and dyslexia. So when Graham Dwyer, a 40-year-old architect, started&nbsp;</span><span style=\"font-size: 0.875rem;\">taking an interest in her she jumped headlong into the relationship. What happened next would&nbsp;</span><span style=\"font-size: 0.875rem;\">lead to an obsessive and bizarre relationship, which would ultimately end in tragedy.</span></p>', '', ',560', '', '0', '2021-11-23', NULL, '9,90,91,93', NULL, '48 mins', 'HD', 0, 0, 0, '', 0, 'Secrets of a Psychopath,Psychopath,Death,Documentary,Ireland,Dublin,Murder ,Thriller Crime', '                36-year-old Elaine O’Hara had very little to live for. She was overweight, depressed and suffered from asthma, diabetes and dyslexia. So when Graham Dwyer, a 40-year-old architect, started taking an interest in her she jumped headlong into the relationship. What happened next would lead to an obsessive and bizarre relationship, which would ultimately end in tragedy.                                                                                    ', 'Secrets of a Psychopath,Psychopath,Death,Documentary,Ireland,Dublin,Thriller Crime', '', 0, 1, 31, 31, 31, 32, '2021-11-23 20:48:29'),
(116, '', 'Crimes that Shook Ireland', 'Crimes that Shook Ireland', 'crimes-that-shook-ireland', '<p>From the strange and notorious Malcolm MacArthur to evil serial killers John Shaw and Geoffrey&nbsp;<span style=\"font-size: 0.875rem;\">Evans this mini-series looks at some of Ireland\'s most brutal criminals, reconstructing the&nbsp;</span><span style=\"font-size: 0.875rem;\">gruesome moments that shocked a nation.</span></p>', '65,577,578,579,580,581,582,583,586,587,588,589,590,591,592,593,594,595,596,597,598,599,600,602,606,608,609,610,612,613,614,615,617,618,620,622,623,624,625,626,627,628,631,632,633,634,635,636,637,638,640,641,642,643,644,645,646,648,650,651,652,653,654', '657,598', NULL, '0', '2021-11-23', '88', '8,89,93', NULL, '48 mins', 'HD', 0, 1, 0, '', 0, 'Crime,Ireland,Mini-Series,John Shaw,Geoffrey Evans,Ireland ,Dublin ,Irish Crime ,True Story ', '                                                                                                                                From the strange and notorious Malcolm MacArthur to evil serial killers John Shaw and Geoffrey Evans this mini-series looks at some of Ireland\'s most brutal criminals, reconstructing the gruesome moments that shocked a nation.                                                                                                ', 'Crime,Ireland,Mini-Series,Malcolm MacArthur,John Shaw,Geoffrey Evans,Dublin ,Ireland ', '', 1, 1, 47, 47, 47, 48, '2021-11-23 21:28:59'),
(118, '', 'Diana: An American Love Affair', 'Diana: An American Love Affair', 'diana-an-american-love-affair', '<p>She was the world’s most famous woman and nowhere on the planet was she more famous and adored than in the United States. British royalty has always fascinated America, but America was in love with Diana, Princess of Wales. When she died tragically in 1997, the grief of ordinary people was palpable.</p><p>Now the story of the World’s most famous princess and her enduring relationship with the United States is told in a one-hour documentary TV special. The program will follow America’s obsession with Diana – from her engagement and marriage to Prince Charles in 1981 to her celebrated first state visit to the United States and the White House in 1985; From her high profile and very-public divorce to her tragic death in Paris in 1997.</p><p>Using archive footage and new interviews with friends, confidantes and commentators, the program features witness testimony to the Diana story, and reminiscences of one of the most remarkable people of recent times.</p>', ',559', ',553', '', '0', '2021-11-23', '3,88', '9,112', NULL, '43 mins', 'HD', 0, 1, 0, '', 0, 'Princess,Diana,Royalty,America,Fame,Princess Diana,Princess of Wales,Love Affair,Dublin,Ireland', '                                                                                She was the world’s most famous woman and nowhere on the planet was she more famous and adored than in the United States. British royalty has always fascinated America, but America was in love with Diana, Princess of Wales. When she died tragically in 1997, the grief of ordinary people was palpable.                                                            ', 'Princess ,Diana,Royalty,America,Fame,Princess Diana,Princess of Wales,Dublin,Ireland,Irish American Love Affair', '', 0, 1, 147, 147, 147, 148, '2019-04-04 00:00:00'),
(119, '', 'Sinatra And The Jack Pack', 'Sinatra And The Jack Pack', 'sinatra-and-the-jack-pack', '<p><span style=\"font-size: 0.875rem;\">Frank Sinatra desperately wanted to be a part of the gang. He had his own famed ‘Rat Pack’, of&nbsp;</span><span style=\"font-size: 0.875rem;\">course, made up of hard-drinking, womanizing, louche individuals like himself – guys like Dean&nbsp;</span><span style=\"font-size: 0.875rem;\">Martin, Sammy Davis Junior and Peter Lawford.&nbsp;</span><span style=\"font-size: 0.875rem;\">But the guy ‘ol blue eyes’ really wanted to hang&nbsp;</span><span style=\"font-size: 0.875rem;\">with was Lawford’s brother-in-law, the Real Chairman of the Board, John.F.Kennedy.</span></p><p>Sinatra and Kennedy had first met in 1956. The two men liked the good things in life and thrived&nbsp;<span style=\"font-size: 0.875rem;\">on their mutual ability to attract women, male admirers and adoring acolytes who would help to&nbsp;</span><span style=\"font-size: 0.875rem;\">show them a good time. As Kennedy edged towards the Presidency, Sinatra assiduously&nbsp;</span><span style=\"font-size: 0.875rem;\">courted the relationship, even recording a special version of his hit “High Hopes” as the&nbsp;</span><span style=\"font-size: 0.875rem;\">candidate’s campaign song and persuading many of his influential Hollywood friends to back&nbsp;</span><span style=\"font-size: 0.875rem;\">Jack</span></p><p>His loyalty was rewarded with exceptional access to the Kennedy White House, including JFK’s&nbsp;<span style=\"font-size: 0.875rem;\">trust to allow him to accompany Jackie to a number of celebratory balls on the night of the&nbsp;</span><span style=\"font-size: 0.875rem;\">inauguration.</span></p><p>But on the evening of 20th March 1962, Frank was unexpectedly and abruptly ejected from&nbsp;<span style=\"font-size: 0.875rem;\">Jack\'s gang. This is the story of how and why.</span></p>', ',558', '', '', '0', '2021-11-23', '3,88', '9,93,112', NULL, '43 mins', 'HD', 0, 1, 0, '', 0, 'Frank Sinatra,JFK,Kennedy,Gang,Music,Presidency,President of the United States,Dublin,Ireland,Irish History', '                                Frank Sinatra desperately wanted to be a part of the gang. He had his own famed ‘Rat Pack’, of course, made up of hard-drinking, womanizing, louche individuals like himself – guys like Dean Martin, Sammy Davis Junior and Peter Lawford.                                                                                     ', 'Frank Sinatra,JFK,Kennedy,Gang,Music,Presidency,President of the United States,Dublin,Ireland,Wexford', '', 0, 1, 35, 35, 35, 36, '2019-04-04 00:00:00'),
(120, '', 'Bob Geldof On WB Yeats: A Fanatic Heart', 'Bob Geldof On WB Yeats: A Fanatic Heart', 'bob-geldof-on-wb-yeats-a-fanatic-heart', '<p>This two-part retrospective on the life and work of WB Yeats is presented through the prism of a&nbsp;<span style=\"font-size: 0.875rem;\">personal journey by Ireland’s most celebrated international advocate of the modern age, the&nbsp;</span><span style=\"font-size: 0.875rem;\">musician and political activist, Bob Geldof. The programmes are crafted to reflect the birth of&nbsp;</span><span style=\"font-size: 0.875rem;\">Ireland as a nation and its impact on the life and work of this literary genius.</span></p>', ',556', ',557', '', '0', '2021-11-23', '88', '93,117', NULL, '', 'HD', 0, 1, 0, '', 0, 'Bob Geldof,Boomtown Rats,WB Yeats,Musician,Political Activist,Dublin,Ireland', '                                                                This two-part retrospective on the life and work of WB Yeats is presented through the prism of a personal journey by Ireland’s most celebrated international advocate of the modern age, the musician and political activist, Bob Geldof. The programmes are crafted to reflect the birth of Ireland as a nation and its impact on the life and work of this literary genius.                                                ', 'Bob Geldof,Boomtown Rats,WB Yeats,Musician,Political Activist,Dublin,Ireland,Biopic', '', 0, 1, 88, 88, 88, 89, '2019-04-04 00:00:00'),
(121, '', 'Solved & Unsolved', 'Solved & Unsolved', 'solved-unsolved', '<p>Solved &amp; Unsolved<br></p>', '', '', '', '0', '2021-11-24', NULL, '8,79,89,90', NULL, '25 mins', 'HD', 0, 1, 0, '', 0, 'Murder,Solved ,Unsolved,Cases,Crimes,Factual ,Ireland,Dublin', '                                                Solved & Unsolved                                    ', 'Murder,Solved,Unsolved,Cases,Crimes,Irish Crime,Ireland,Dublin,True Story', '', 0, 1, 67, 67, 67, 68, '2021-11-24 00:14:11'),
(122, '', 'Ireland\'s most shocking crimes', 'Ireland\'s most shocking crimes', 'irelands-most-shocking-crimes', '<p>Profiles of criminals responsible for some of the most shocking crimes possible in Ireland.&nbsp;<span style=\"font-size: 0.875rem;\">Recalling the crimes </span>and the subsequent investigations.</p>', ',555', '', '', '0', '2021-11-24', '88', '89,90,93', NULL, '', 'HD', 0, 1, 0, '', 0, 'Crime,Ireland,Criminals,Investigation,Dublin,True Story,Shocking Crime', 'Profiles of criminals responsible for some of the most shocking crimes possible in Ireland. Recalling the crimes and the subsequent investigations.                        ', 'Crime,Ireland,Criminals,Investigation,Dublin,Factual,Investigation ', '', 0, 1, 17, 17, 17, 18, '2021-11-24 00:23:08'),
