(124, '', 'Return To Downton Abbey', 'Return To Downton Abbey', 'return-to-downton-abbey', '<p>Join Jim Carter (Carson the butler) as he returns to Highclere Castle, the location of Downton&nbsp;<span style=\"font-size: 0.875rem;\">Abbey, one of the most successful television drama phenomena of the past decade. The series&nbsp;</span><span style=\"font-size: 0.875rem;\">has touched the hearts of millions and has driven massive television audiences worldwide. This&nbsp;</span><span style=\"font-size: 0.875rem;\">special features other Downton stars including Hugh Bonneville, Michelle Dockery, Allan Leech&nbsp;</span><span style=\"font-size: 0.875rem;\">and Lesley Nicol.</span></p>', '565,566,567,568,569,570,571,572,573,574', NULL, NULL, '0', '2021-11-24', '88', '2,10', NULL, '43 mins', 'HD', 0, 1, 0, '', 0, 'Historic,Downton Abbey,TV Drama,Dublin,Ireland,BTS', '                                                                                Join Jim Carter (Carson the butler) as he returns to Highclere Castle, the location of Downton Abbey, one of the most successful television drama phenomena of the past decade.                                                             ', 'Historic,Downton Abbey,TV Drama,Dublin,Ireland,BTS', '', 1, 1, 12, 12, 12, 13, '2021-11-24 01:41:46'),
(125, '', 'Red Hurley Songs ', 'Red Hurley Songs', 'red-hurley-songs', '<p>An Irish popular singer whose career has spanned several decades beginning in the 1970s. He is principally known as a solo artist, but he has also performed with various bands and pop groups, most notably The Nevada Showband, with whom he enjoyed his first series of number one records in the 1970s. He represented Ireland at the Eurovision Song Contest in 1976 with the song&nbsp;<br></p>', '', '563,564', NULL, '0', '2021-11-24', '88', '2,15,117,131,134', NULL, '47 mins', 'HD', 0, 1, 0, '', 0, 'Music,Songs of Prayer,Songs,Religion,Choir,Music Documentary ,Inspirational Music,Dublin,Ireland', '                                                                                                                Red Hurley Songs                                                                     ', 'Music,Songs of Prayer,Songs,Religion,Choir,Music Documentary,Inspirational Music,Dublin,Ireland,Eurovision Song', '', 1, 1, 6, 6, 6, 7, '2021-11-24 11:56:08'),
(126, '', 'Obsession', 'Obsession', 'obsession', '<p>Obsession<br></p>', '562', '561', NULL, '0', '2021-11-25', '88', '2,8,93', NULL, '27 mins', 'HD', 0, 1, 0, '', 0, 'Obsession,Love,Madonna,Tv-Series,Crime,Dublin,Ireland,Celebrity,True Story', '                Obsession                                                ', 'Obsession,Love,Madonna,TV-Series,Crime,Dublin,Ireland,celebrity,True Story', '', 1, 1, 27, 27, 27, 28, '2021-11-25 13:49:46'),
(127, '', 'The Wireless: A Century Of Irish Radio', 'The Wireless: A Century Of Irish Radio', 'the-wireless-a-century-of-irish-radio', '<p>A documentary celebrating 100 years of Irish radio.<br></p>', ',554', ',553', '', '0', '2021-11-25', '88', '9,15,93', NULL, '47 mins', 'HD', 0, 0, 0, '', 0, 'Radio,Irish Radio,100 Years,Celebration,Nostalgia,Irish History,Ireland ,Dublin', '                A documentary celebrating 100 years of Irish radio.                                                            ', 'Radio,Irish Radio,100 Years,Celebration,Ireland,Dublin,Nostalgia,Irish-History', '', 0, 1, 28, 28, 28, 29, '2019-04-04 00:00:00'),
(128, '', 'The Ana Kriegel Murder', 'The Ana Kriegel Murder', 'the-ana-kriegel-murder', 'The Virgin Media One documentary ‘The Ana Kriegel Murder: A Young Life Lost’ featured Senior Journalists, Barristers and Family Friends tell Ana\'s story, looking at the circumstances around her murder, the extensive Garda investigation and the trial that followed. Also contains a series of new photographs released by Ana’s family. It also examined the sentencing the case and explored the lasting impact of Ana\'s death. ', ',552', 'NULL', 'NULL', '0', '2021-11-24', '88', '8,93,165', 'NULL', '48 min', 'HD', 0, 1, 0, '', 0, 'Murder, Thriller, Crime, True Story, Dublin, Ireland', '                                                                                                                                                The Virgin Media One documentary ‘The Ana Kriegel Murder: A Young Life Lost’ featured Senior Journalists, Barristers and Family Friends tell Ana\'s story, looking at the circumstances around her murder, the extensive Garda investigation and the trial that followed. Also contains a series of new photographs released by Ana’s family. It also examined the sentencing the case and explored the lasting impact of Ana\'s death.                                                                                                             ', 'Murder, Thriller, Crime, True Story, Dublin, Ireland', '1', 0, 1, 96, 96, 96, 97, '2019-04-04 00:00:00'),
(129, '', 'The Kennedys\' Irish Mafia', 'The kennedys\' Irish Mafia', 'the-kennedys-irish-mafia', '<p><span style=\"font-size: 0.875rem;\">Frank Sinatra desperately wanted to be a part of the gang. He had his own famed ‘Rat Pack’, of&nbsp;</span><span style=\"font-size: 0.875rem;\">course, made up of hard-drinking, womanizing, louche individuals like himself – guys like Dean&nbsp;</span><span style=\"font-size: 0.875rem;\">Martin, Sammy Davis Junior and Peter Lawford.&nbsp;</span><span style=\"font-size: 0.875rem;\">But the guy ‘ol blue eyes’ really wanted to hang&nbsp;</span><span style=\"font-size: 0.875rem;\">with was Lawford’s brother-in-law, the Real Chairman of the Board, John.F.Kennedy.</span></p><p>Sinatra and Kennedy had first met in 1956. The two men liked the good things in life and thrived&nbsp;<span style=\"font-size: 0.875rem;\">on their mutual ability to attract women, male admirers and adoring acolytes who would help to&nbsp;</span><span style=\"font-size: 0.875rem;\">show them a good time. As Kennedy edged towards the Presidency, Sinatra assiduously&nbsp;</span><span style=\"font-size: 0.875rem;\">courted the relationship, even recording a special version of his hit “High Hopes” as the&nbsp;</span><span style=\"font-size: 0.875rem;\">candidate’s campaign song and persuading many of his influential Hollywood friends to back&nbsp;</span><span style=\"font-size: 0.875rem;\">Jack</span></p><p>His loyalty was rewarded with exceptional access to the Kennedy White House, including JFK’s&nbsp;<span style=\"font-size: 0.875rem;\">trust to allow him to accompany Jackie to a number of celebratory balls on the night of the&nbsp;</span><span style=\"font-size: 0.875rem;\">inauguration.</span></p><p>But on the evening of 20th March 1962, Frank was unexpectedly and abruptly ejected from&nbsp;<span style=\"font-size: 0.875rem;\">Jack\'s gang. This is the story of how and why.</span></p>', ',551', '', '', '0', '2021-11-23', '88', '89,113', NULL, '43 mins', 'HD', 0, 0, 0, '', 0, 'Frank Sinatra,JFK,Kennedy,Gang,Music,Presidency,President of the United States', '                                                                                Frank Sinatra desperately wanted to be a part of the gang. He had his own famed ‘Rat Pack’, of course, made up of hard-drinking, womanizing, louche individuals like himself – guys like Dean Martin, Sammy Davis Junior and Peter Lawford.                                                             ', 'Frank Sinatra,JFK,Kennedy,Gang,Music,Presidency,President of the United States', '', 0, 1, 23, 23, 23, 24, '2019-04-04 00:00:00');
